import { useState } from "react";

function List({todos, setTodos}) {

  return (
    <div>
        <ul>
            {
                todos.map((todo,i) => (
                    <li key={i}>
                        <input type="radio" name="" id="" value={todo.done}/>
                        <input type="text" name="" id="" value={todo.text}/>
                    </li>
                ))
            }
            
        </ul>
    </div>
  )
}

export default List
